    component: HardwaresLayout,
    meta: { requiresAuth: false }
  },
  {
    path: '/send-offline-helper',
    name: 'SendOfflineHelper',
    component: SendOfflineHelper,
    meta: { requiresAuth: false }
  },
  {
    path: '/dapp-submission',
    component: DappSubmission,
    children: [
      {
        path: '',
        name: 'DappSubmission',
        component: AboutYourDapp,
        meta: { requiresAuth: false }
      },
      {
